def _get_with(self, key):
    # other: fancy integer or otherwise
    if isinstance(key, slice):
        # _convert_slice_indexer to determine if this slice is positional
        # or label based, and if the latter, convert to positional
        slobj = self.index._convert_slice_indexer(key, kind="getitem")
        return self._slice(slobj)
    elif isinstance(key, ABCDataFrame):
        raise TypeError(
            "Indexing a Series with DataFrame is not "
            "supported, use the appropriate DataFrame column"
        )
    elif isinstance(key, tuple):
        return self._get_values_tuple(key)

    # Ensure key is always treated as list-like
    key = ensure_index(key)

    # Handle the case when a key has no matches
    if is_list_like(key):
        filtered_key = [k for k in key if k in self.index]
        if not filtered_key:
            raise KeyError(f"None of {key} are in the {self.index}")
        return self.loc[filtered_key]
    else:
        raise TypeError(f"Unsupported key type: {type(key)}")
